    const submitHandler = event => {
        event.preventDefault();
        const newExpenseItem = {
            title: enteredTitle,
            date: new Date(enteredDate),
            amount: enteredAmount
        }
        props.onSaveExpenseData(newExpenseItem);
        setEnteredTitle('');
        setEnteredAmount('');
        setEnteredDate('');
    }

